import React from 'react';

const Navigate = () => {
  return( 
    <div>
        <nav class="navbar navbar-expand navbar-dark">
          <div class="container-fluid">
            <ul>
              <li calss="nav-item">
                <a class="nav-link" href='/res'>link</a>
              </li>
            </ul>
          </div>
        </nav>
    </div>
  )
}
 
export default Navigate;
